TEST(kk, t1)
{
  Solution sol;
  vector<string> words{ "abcd", "dcba", "lls", "s", "sssll" };
  vector<vector<int>> expect{ { 0, 1 }, { 1, 0 }, {2, 4}, { 3, 2 }};
  EXPECT_EQ(sol.palindromePairs(words), expect);
}

TEST(kk, t2)
{
  Solution sol;
  vector<string> words{ "bat", "tab", "cat" };
  vector<vector<int>> expect{ { 0, 1 }, { 1, 0 } };
  EXPECT_EQ(sol.palindromePairs(words), expect);
}

TEST(kk, t3)
{
  Solution sol;
  vector<string> words{ "a", "" };
  vector<vector<int>> expect{ { 0, 1 }, { 1, 0 } };
  EXPECT_EQ(sol.palindromePairs(words), expect);
}

TEST(kk, t3_1)
{
  Solution sol;
  vector<string> words{ "a","abc","aba",""};
  vector<vector<int>> expect{{0,3},{3,0},{2,3},{3,2}};
  sort(expect.begin(), expect.end());

  auto actual = sol.palindromePairs(words);
  sort(actual.begin(), actual.end());
  EXPECT_EQ(actual, expect);
}

